import { useNavigate } from "react-router-dom";

export default function Logout() {
  let navigate = useNavigate();
  return new Promise((resolve) => {
    localStorage.removeItem("userData");
    navigate("/");
    resolve();
  }).then(() => {
    window.location.reload();
  });
}
